ase_app_id_file.json\n# This is the default location where Firebase init code expects to find firebase_app_id_file.json file\necho \"Will copy ${FIREBASE_APP_ID_JSON} to final destination: ${FIREBASE_JSON_DESTINATION}\"\n\n# Copy over the prod GoogleService-Info.plist for Release builds\ncp \"${GOOGLESERVICE_INFO_FILE}\" \"${FIREBASE_PLIST_DESTINATION}\"\n\n# Copy over the prod firebase_app_id_file.json for Release builds\ncp \"${FIREBASE_APP_ID_FILE}\" \"${FIREBASE_JSON_DESTINATION}\"\n";
